아래의 절차는 특정 이름(targetName)이 발견된 고유 이름 목록(nameList)에서 인덱스를 표시하도록 의도되었습니다. targetName이 nameList에서 발견되지 않으면 코드가 0을 표시해야 합니다.
 절차 FindName (nameList, targetName)
 {
  index ← 0
  FOR EACH name IN nameList
  {
   index ← index + 1
   IF (name = targetName)
   {
   foundIndex ← index
   }
   ELSE
   {
   foundIndex ← 0
   }
  }
  DISPLAY (foundIndex)
 }
 다음 중 절차가 의도한 대로 작동하지 않음을 증명할 수 있는 절차 호출은 무엇입니까?

배열 A는 각각 4바이트의 256개 요소를 포함합니다. 첫 번째 요소는 물리 주소 4,096에 저장되어 있습니다.
배열 B는 각각 4바이트의 512개 요소를 포함합니다. 첫 번째 요소는 물리 주소 8,192에 저장되어 있습니다.
배열 A와 B만이 초기에는 비어 있고, 물리적으로 주소 지정되고, 물리적으로 태그가 부착된, 직접 매핑된, 2K바이트 캐시(블록 크기 8바이트)에 캐시될 수 있다고 가정합니다. 그런 다음 다음 루프가 실행됩니다.
for (i = 0; i < 256; i++)
        A[i] = A[i] + B[2*i];
루프가 실행되는 동안, 캐시가 쓰기 통과 정책을 가지고 있다면 메모리에 몇 바이트가 쓰여질까요?
